    return (
        <div className="App">
            <ThreeScene />
            <a href="https://github.com/jmurphy5613">
            <img src="/github.png" className="github" />
            </a>

            <div className="main-content">
            <h1>
                <h3>
                Hey there, I'm John.
                </h3>
                I'm a passionate 
                <Typed style={{ margin: '0 0 1rem 0'  }} typeSpeed={90} backSpeed={50} backDelay={10} loop strings={['full stack developer', 'frc competitor']} />
